// src/components/Navbar.js
import React from 'react';
import './Navbar.css';

const Navbar = () => (
    <nav className="navbar">
        <h1 className="navbar-logo">Perfume Shop</h1>
        <ul className="navbar-links">
            <li><a href="/" className="navbar-button">Home</a></li>
            <li><a href="/collections" className="navbar-button">Collections</a></li>
            <li><a href="/offers" className="navbar-button">Offers</a></li>
        </ul>
    </nav>
);

export default Navbar;
